function z80execute(s,bken,bkpt) {
 z80executeStates = s;
 z80restStates = Math.floor(z80restStates + s);

 if(z80hlt) {
   z80restStates = 0;
   return;
 }

 do {
  if (z80break == false) {
    if ((bken == true) && (z80pc == bkpt) && (fetch == false)) {
      z80break = true;
      z80restStates = 0;
      console.log("\n*** PC BREAK ***\n")
      z80debug_log();
      disasm(z80pc,1);
      return;
    }
  } else {
    if (z80exitbreak == 1) {
      /* step */
      z80exitbreak = 0;
      z80break = true;
      console.log("\n*** STEP ***\n")
    } else if ((bken == false) || (z80exitbreak == 2)) {
      /* run */
      z80exitbreak = 0;
      z80break = false;
      console.log("\n*** RUN ***\n")
    } else {
      z80restStates = 0;
      return;
    }
  }

  var op = z80read8(z80pc);
  _state = _stateXX[op];
  _length = _lengthXX[op];
  z80opex = op;
  z80pcex = z80pc;
  _z80executeXX[op]();

  if (z80break) {
      z80debug_log();
      disasm(z80pc,1);
  }

  z80restStates -= _state;
 } while(z80restStates > 0);
}

